// This example requires the Visualization library. Include the libraries=visualization
// parameter when you first load the API. For example:
// <script src="https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY&libraries=visualization">
let map, garbageheatmap, recycleheatmap, compostheatmap;

function initMap() {
  map = new google.maps.Map(document.getElementById("map"), {
    zoom: 12,
    center: { lat: 51.049999, lng: -114.066666 },
    mapTypeId: "satellite",
  });
  garbageheatmap = new google.maps.visualization.HeatmapLayer({
    data: getGarbagePoints(),
    map: map,
  });
  recycleheatmap = new google.maps.visualization.HeatmapLayer({
    data: getRecyclePoints(),
    map: map,
  });
  compostheatmap = new google.maps.visualization.HeatmapLayer({
    data: getCompostPoints(),
    map: map,
  });
}

function toggleGarbage() {
  garbageheatmap.setMap(garbageheatmap.getMap() ? null : map);
}

function toggleCompost() {
  compostheatmap.setMap(compostheatmap.getMap() ? null : map);
}

function toggleRecycle() {
  recycleheatmap.setMap(recycleheatmap.getMap() ? null : map);
}

function changeGradient() {
  const gradient = [
    "rgba(0, 255, 255, 0)",
    "rgba(0, 255, 255, 1)",
    "rgba(0, 191, 255, 1)",
    "rgba(0, 127, 255, 1)",
    "rgba(0, 63, 255, 1)",
    "rgba(0, 0, 255, 1)",
    "rgba(0, 0, 223, 1)",
    "rgba(0, 0, 191, 1)",
    "rgba(0, 0, 159, 1)",
    "rgba(0, 0, 127, 1)",
    "rgba(63, 0, 91, 1)",
    "rgba(127, 0, 63, 1)",
    "rgba(191, 0, 31, 1)",
    "rgba(255, 0, 0, 1)",
  ];
  garbageheatmap.set(
    "gradient",
    garbageheatmap.get("gradient") ? null : gradient
  );
  compostheatmap.set(
    "gradient",
    compostheatmap.get("gradient") ? null : gradient
  );
  recycleheatmap.set(
    "gradient",
    recycleheatmap.get("gradient") ? null : gradient
  );
}

function changeRadius() {
  garbageheatmap.set("radius", garbageheatmap.get("radius") ? null : 20);
  compostheatmap.set("radius", compostheatmap.get("radius") ? null : 20);
  recycleheatmap.set("radius", recycleheatmap.get("radius") ? null : 20);
}

function changeOpacity() {
  garbageheatmap.set("opacity", garbageheatmap.get("opacity") ? null : 0.2);
  compostheatmap.set("opacity", compostheatmap.get("opacity") ? null : 0.2);
  recycleheatmap.set("opacity", recycleheatmap.get("opacity") ? null : 0.2);
}

